import React from 'react';
import '../../css/header.css';
import classes from './header.module.css';
import {NavLink} from "react-router-dom";

const Header = (props) => {
                    let friendElement = props.Sidebar.friend.map(friend => (<div>
                        <div className={classes.iconsProfile}>1</div>
                        <p>{friend.name}</p></div>));
                    let navigationElement = props.Sidebar.navigation.map(nav => (
                        <li><NavLink to={nav.id} activeClassName={classes.active}>{nav.name}</NavLink></li>));
                    return   <header className={classes.header}>
                        <div className={classes.contentHeader}>
                            <div className={classes.logo}>
                                <img className={classes.icons}
                                     src='https://3.bp.blogspot.com/-gSCjFoMwSrM/Wmhhcg2_WsI/AAAAAAAAN0s/YF9kM5Jnt30hautbcSOIg70qUQhEGyqWgCLcBGAs/s1600/dallas_mavericks.png'></img>
                            </div>
                            <div className={classes.friends}>
                                {friendElement}
                            </div>
                            <div className={classes.menu}>
                                <ul>
                                    {navigationElement}
                                </ul>
                            </div>
                        </div>

                        <NavLink to={'/login'}>{props.isAuth ? props.login:'login'}</NavLink>
                    </header>
}
export default Header;
